  false,\n\t\"url\": null,\n\t\"notes\": \"This management plan was prepared by the
  U. S. Fish and Wildlife Service for Morgan Brake National Wildlife Refuge. Data
  was provided by the Refuge and Area Office Wildlife Resources Staff. The plan outlines
  goals and objectives recommended by the Service Fisheries Assistance program. The
  plan is to be used as a guide in managing the Refuge's extensive fishery resources
  to the benefit of the resource and the recreational interest of the local sport
  fishermen and to provide a food supply for piscivorous birds.\",\n\t\"license_title\":
